import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function NavScrollExample() {
  return (
    <nav class="navbar navbar-expand-lg navbar-light bg-dark"  cla>
    <div class="container-fluid">
      <a class="navbar-brand" href="#" style={{color:" white", fontWeight:"600"}}>Vishal Resume</a>
      <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent"
        aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div class="collapse navbar-collapse" id="navbarSupportedContent">
        <ul class="navbar-nav me-auto mb-2 mb-lg-0" style={{marginleft:"15"}}>
          <li class="nav-item" id="navlist">
            <a class="nav-link active" aria-current="page" href="#intro" style="background: none;">Introduction</a>
          </li>
          <li class="nav-item" id="navlist">
            <a class="nav-link" href="#about">About</a>
          </li>
          <li class="nav-item" id="navlist">
            <a class="nav-link" href="#review">Review</a>
          </li>
          <li class="nav-item" id="navlist">
            <a class="nav-link" href="#contact">Contact</a>
          </li>

        </ul>
        <form class="d-flex">
{/* 
          <button class="btn btn-outline-success" id="btn1" type="submit"><a href="./assests/images/backgroud card.jpg"  download style="text-decoration: none; color: black;">Download CV</a></button> */}
        </form>
      </div>
    </div>
  </nav>
  );
}

export default NavScrollExample;
